      const fileName = 'HelloWorld.pdf';

      function downloadAsPDF(pdf) {
        if (pdf.startsWith('JVB')) {
          const base64String = 'data:application/pdf;base64,' + pdf;
          downloadFileObject(base64String, fileName);
        } else if (pdf.startsWith('data:application/pdf;base64')) {
          downloadFileObject(pdf, fileName);
        } else {
          alert('Not a valid Base64 PDF string. Please check');
        }
      }

      function downloadFileObject(base64String, fileName) {
        const linkSource = base64String;
        const downloadLink = document.createElement('a');
        downloadLink.href = linkSource;
        downloadLink.download = fileName || 'FE.pdf';
        downloadLink.click();
      }
